import { Component } from "react";
import { BrowserRouter,Routes,Route} from "react-router-dom";
import Home from './Components/Home/index.js'
class App extends Component{
  render(){
    return (
    <>
    <Home/>
     <BrowserRouter>
      <Routes>
        <Route exact path="/" element={<Home/>}/>
      </Routes>
     </BrowserRouter>
     </>
    )
  }
}
export default App;
